import Main from "./components/MainPage";
import Header from "./components/Header";

function App() {

  let links = [
    { label : 'Home', link : '#home'},
    { label : 'About', link : '#about'},
    { label : 'Portfolio', link : '#portfolio'},
    { label : 'Contact', link : '#contact'}
  ]

  return (
    <div className="App">
      <Header links="blabla" />
      <Main></Main>
    </div>
  );
}

export default App;
